        "weDoNotSellOrRentYourPersonalInformationToThirdParties":
            MessageLookupByLibrary.simpleMessage(
                "Hatuuzi au kukodisha taarifa zako binafsi kwa wahusika wa tatu. Hata hivyo, tunaweza kushiriki data yako na washirika wa kuaminika wanaotusaidia kuendesha na kuboresha huduma zetu. Washirika hawa wanachaguliwa kwa makini na wanahitaji kufuata viwango vya siri vya faragha, kuhakikisha kuwa taarifa zako zinabaki salama na za siri."),
        "weGatherARangeOfInformationToEnhanceYourExperience":
            MessageLookupByLibrary.simpleMessage(
                "Tunakusanya aina mbalimbali za taarifa kuboresha uzoefu wako kwenye tovuti yetu na huduma zetu. Hii inajumuisha maelezo binafsi unayotoa kwa hiari, kama jina lako, anwani yako ya barua pepe, na maelezo mengine ya mawasiliano. Zaidi ya hayo, tunakusanya data ya matumizi kama anwani yako ya IP, aina ya kivinjari, na mfumo wa uendeshaji kupitia kuki, faili za logi, na teknolojia nyingine za ufuatiliaji. Teknolojia hizi zinatusaidia kuelewa jinsi unavyoingiliana na tovuti yetu, ikituwezesha kuboresha huduma zetu na kutoa uzoefu ulioandaliwa kwa mtu binafsi. Tunahakikisha kwamba data yote inayokusanywa inashughulikiwa kwa siri na hatua kali za usalama."),
        "weImplementAppropriateSecurityMeasures":
            MessageLookupByLibrary.simpleMessage(
                "Tunatekeleza hatua za usalama zinazofaa kulinda taarifa zako binafsi dhidi ya upatikanaji usioidhinishwa, marekebisho, au ufichuzi. Licha ya juhudi zetu, hakuna upitishaji wa data juu ya mtandao unaoweza kuhakikisha usalama kamili."),
        "weImplementRobustSecurityMeasuresIncludingEncryption":
            MessageLookupByLibrary.simpleMessage(
                "Tunatekeleza hatua madhubuti za usalama ikiwa ni pamoja na usimbaji, seva salama, na ukaguzi wa mara kwa mara kulinda data yako. Jukwaa letu linazingatia viwango vya sekta kwa ulinzi wa data na faragha. Pia tunatoa uwazi kuhusu taratibu zetu za usalama na tunafungua kujibu maswali yoyote."),
        "weMayUpdateTheseTermsAndConditionsPeriodically":
            MessageLookupByLibrary.simpleMessage(
                "Tunaweza kusasisha Masharti haya mara kwa mara ili kuakisi mabadiliko katika huduma zetu au mahitaji ya kisheria. Wakati masasisho yanapofanywa, tutaweka masharti yaliyorekebishwa kwenye ukurasa huu na tarehe mpya ya kuanza kutumika. Ni jukumu lako kuyapitia masharti haya mara kwa mara ili kujua mabadiliko yoyote. Kuendelea kutumia huduma zetu baada ya uchapishaji wa mabadiliko yoyote ni kukubali mabadiliko hayo. Ikiwa hukubaliani na masharti yaliyorekebishwa, unapaswa kuacha kutumia huduma zetu. Tunakuhimiza uangalie ukurasa huu mara kwa mara ili kuhakikisha unajua masharti ya hivi punde."),
        "weMayUpdateThisPrivacyPolicyFromTimeToTime":
            MessageLookupByLibrary.simpleMessage(
